import './App.css';
import { gql, useQuery } from '@apollo/client';


const query = gql`
const GetTodosWithUser{
  getTodos{
  id
  title
  completed
  user{
  id
  name
  }
  }
}

`


function App() {
  const { data, loading } = useQuery(query)
  if (!loading) return <h1> Loading...... </h1>
  return (
    <div className="">{JSON.stringify(data)}</div>
  );
}

export default App;
